import React from 'react'
// import { Link } from 'react-router-dom';
// import { Button } from './Button'
import "./Footer.css";

function Footer() {

    const year = new Date().getFullYear();
    return (
      <>
        <div>
        <link href="https://fonts.googleapis.com/css?family=Roboto:100" rel="stylesheet" />
        <p id="head1" className="header">Awesome designs</p>
        <p id="head2" className="header">Just</p>
        <p id="head3" className="header">For you</p>
        <p id="head4" className="header">simple and awesome all the time</p>
        <p id="head5" className="header">Welcome to BA designs</p>
        <button>Continue</button>
        <div className="light x1" />
        <div className="light x2" />
        <div className="light x3" />
        <div className="light x4" />
        <div className="light x5" />
        <div className="light x6" />
        <div className="light x7" />
        <div className="light x8" />
        <div className="light x9" />
      </div>
      </>
    )
}

export default Footer
